import './bigSectionCard.css'
import {BigCard} from '../BigCard/BigCard'
import geroy from '../../pages/image/films/Герой наших снов/Герой наших снов визитка.jpg'

export default function BigSectionCard({className}) {
    const films = [
        {
            key: 1,
            image: geroy,

        },
        {
            key: 2,
            image: geroy,
        }
    ]
    return (
        <>
            {films.map((film) => {
                return (
                    <section className='contentFilm__bigSectionCard' key={film.key}>
                        <BigCard src={film.image} name={'Герой наших снов'} rental={'aasdasd'} style={{
                            width: '32%'
                        }}/>
                    </section>
                )
            })}
        </>
    )
}
